import { AnalyticsEvent } from './analytics-event';
import { ComponentClickCollectionDimension } from './custom-dimensions';
export class MetaFunctionClick extends AnalyticsEvent {
    constructor(analyticsSetup, linkItem) {
        super(analyticsSetup);
        this.context.eventAction = 'PAGHomeNav_MetaFunction_Click';
        this.initComponentClick();
        this.populateComponentClick(linkItem);
    }
    initComponentClick() {
        this.componentClick = {
            [ComponentClickCollectionDimension.ClickElementId]: undefined,
            [ComponentClickCollectionDimension.ClickElementName]: undefined,
            [ComponentClickCollectionDimension.ClickElementType]: undefined,
            [ComponentClickCollectionDimension.TargetUrl]: undefined
        };
    }
    populateComponentClick(linkItem) {
        this.componentClick.clickElementId = linkItem.PhraseId;
        this.componentClick.clickElementName = linkItem.Text;
        this.componentClick.clickElementType = 'link';
        this.componentClick.targetUrl = linkItem.Link;
    }
    event() {
        const componentClick = this.componentClick;
        return Object.assign(Object.assign({}, super.event()), { componentClick });
    }
}
